import React from 'react'
import HomePage from './Pages/HomePage/HomePage';
import TeamsPage from "./Pages/TeamsPage/TeamsPage";

function App() {
  var page = "Homepage"
  const returnHome = () => {
    page = "Homepage"
  };
  const goTeamsPage = () => {
    page = "Teams"
  };

  return (
    <div className="App">
      {page === "Homepage"? <HomePage functions = {[goTeamsPage]}/>:<TeamsPage functions = {[returnHome]}/>}
    </div>
  );
}

export default App;
